import React from 'react';
import stockData from '../data/data';

const WatchList = () => {
  return (
    <div>
      <h2>Watchlist</h2>
      <ul>
        {stockData.map(stock => (
          <li key={stock.id}>
            <strong>{stock.symbol}</strong> ({stock.name}) - â‚¹{stock.price.toFixed(2)} 
            <span style={{ color: stock.change >= 0 ? 'green' : 'red' }}>
              {' '}
              {stock.change >= 0 ? '+' : ''}
              {stock.change} ({stock.percentChange}%)
            </span>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default WatchList;
